import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import logo from './logo.svg';
//import '././bootstrap/bootstrap.css';
class BodyDiv extends Component {

  render (){

    let experience = {
        exp1:"CI/CD Cloud environment. Agile Environment / Scrum / Kanban",
        exp2:"Used Amazon Forecast to build time series Recipes in DeepAR+, ETS, ARIMA, and therefore, with data queried from OracleSQLDB",
        exp3:"Used Amazon SageMaker along with Google Colab, running a custom DeepAR notebook instance, which requires all steps across a training model, such as preprocessing data and normalizing, converting to JSON AWS S3 format, plotting the values thus to visualize time series across an x axis, then training, predicting, validating, testing, reducing RMSE to up to 0.0111 and predicting/plotting results of future trends. ",
        exp4:"Used AWS CLI to capture data that the algorithms provide as Output in JSON format, which must be converted/decoded not only to its denormalized conjugate, but an EC2 instance must be setup running python in order to perform these steps",
        exp5:"Took ownership of the configuration testing phase on a aws Sandbox environment and configured a custom product running off Hygieia concepts using containerization techniques, running as EC2 instance with RedHat 7.2.",
        exp6:"Agile Sprint metric collector for measuring performance, thus meeting with IL's for restructure of current Scrum environment which now includes collection of Defects linkage, Bugs, Tasks, Stories, Repositories, Sonar Rules, RCA, DOR, DOD, Throughput, Sprint Capacity, burnout, happy index, Regression testing vs manual testing metrics.",
        exp7:"Acted as product owner, adding items to the backlog and assigning them to the right team member for work on its given sprint",
        exp8:"Learned to work with tools such as, Jira, bitbucket, New relic apm, bamboo, Sonarqube, NodeJS, REACT requests, Curl requests, Makefile executions. ",
        exp9:"Scripting to execute automation techniques using Selenium, and beautiful soup library in python."

    }



    let anrray ={turo:"Perfect Skills",turro:"Networking Skills"}
    let alrray ={turo:"More skills I know",turro:"An yead"}

    return (
        
      <div className="container">
          <h1 className="text-center mb-3 mx-auto">SKILLS</h1>
          
        <div className="row">
            
          <div className="col text-center mb-3 mx-aut">

              <ul>
                <li>{experience.exp1}</li>
                <li>{experience.exp2}</li>
                <li>{experience.exp3}</li>
                <li>{experience.exp4}</li>
                <li>{experience.exp5}</li>
              </ul>
          </div>
          <div className="col text-center mb-3 mx-auto">
          <ul>
          <li>{experience.exp1}</li>
                <li>{experience.exp6}</li>
                <li>{experience.exp7}</li>
                <li>{experience.exp8}</li>
                <li>{experience.exp9}</li>
              </ul>
          </div>

          
          
        </div>
      
      </div>

    )
  }
}


//export default FirstDiv;
export default BodyDiv;
